import React, { Component } from 'react'
import {
  StyleSheet,
  TouchableOpacity,
  Text,
  View,
  Image
} from 'react-native'

import {widthPercentageToDP as wp, heightPercentageToDP as hp} from 'react-native-responsive-screen';
class ShopScreen extends Component {
  state = {
    count: 0
  }
  render(){
      return (
      <View style={styles.container}>
          <Text>{"\n"}</Text>
          <Text style={styles.heading}> Collect your Rewards!</Text>
      <Text>{"\n"}</Text>
      <Text style={styles.content}>Choose from either extensions in Assignment Submission Date, or The Fantastic Dark Mode</Text>
      <Text>{'\n'}</Text>
       <TouchableOpacity style={styles.touchableopacity}>
    <Text>
       <Image source={{uri: 'https://svgsilh.com/svg/2023236.svg'}} 
       style={{width: wp('15%'), height: hp('15%'),resizeMode:'center',flexDirection:'row',alignSelf:'left',float:"left",marginLeft:wp('5%')}} /> 
        <Text style={{paddingTop:wp('10%'),alignSelf:'center'}}>This is the Dark Mode</Text>
        </Text>
           </TouchableOpacity> 


      </View>

      )
  }
}


const styles = StyleSheet.create({
    container:{
      backgroundColor:"#ffffff",
      resizeMode: 'cover',
      flex: 2,
    },
    heading:{
        fontWeight:"bold",
        color:"#25252a",
        fontSize:wp("8%"),
        fontFamily:'sans-serif',
        alignSelf:'center'
    },
    content:{
        fontWeight:"light",
        color:"#bab9b6",
        fontSize:wp("4%"),
        fontFamily:'sans-serif',
        maxWidth:wp("80%"),
        flexShrink: 1,
        alignSelf:'center',

    },
    touchableopacity:{
        borderRadius:wp('5%'),
        backgroundColor:"#f9f9f9",
        width:wp('90%'),
        alignSelf:'center',
    }

  })
export default ShopScreen
